%99%90%E5%AE%9A%E7%9B%A4-%E7%89%B9%E8%A3%BD%E3%83%90%E3%82%A4%E3%83%B3%E3%83%80%E3%83%BC%E7%94%A8%E3%82%AA%E3%83%AA%E3%82%B8%E3%83%8A%E3%83%AB%E3%82%A4%E3%83%B3%E3%83%87%E3%83%83%E3%82%AF%E3%82%B9-ver/dp/B08S3V6W9F</ins></span></p>\n',13,'2022-01-06 15:56:14'),(27,'<p><span style=\"font-family: Manrope;\">Release Date: December 01, 2021</span></p>\n<p><span style=\"font-family: Manrope;\">Artist: YOASOBI</span></p>\n<p><span style=\"font-family: Manrope;\">Related works: Mezamashi TV</span></p>\n<p><span style=\"font-family: Manrope;\">Publisher: Sony Music Entertainment Inc.</span></p>\n<p><span style=\"font-family: Manrope;\">Distributor: Sony Music Solutions Inc.</span></p>\n<p><span style=\"font-family: Manrope;\">Number of discs: 1 (1 CD)</span></p>\n<p><span style=\"font-family: Manrope;\">Total number of songs: 8 /-(album)</span></p>\n<p><span style=\"font-family: Manrope;\">Recording time: 27 minutes 32 seconds / ー</span></p>\n<p></p>\n',14,'2022-01-06 16:31:40'),(28,'<p><span style=\"font-family: Jetbrains Mono;\"><ins>https://www.ebay.com/itm/313777099814</ins></span></p>\n',14,'2022-01-06 16:36:08'),(29,'<ul>\n<li><span style=\"font-family: Manrope;\">Screen: 5.0 inches, IPS LCD capacitive touchscreen, 16M colors.</span></li>\n<li><span style=\"font-family: Manrope;\">Sim: Dual SIM (Nano-SIM, dual stand-by).</span></li>\n<li><span style=\"font-family: Manrope;\">Memory: 64 GB, 3 GB RAM.</span></li>\n<li><span style=\"font-family: Manrope;\">Card slot: microSD, up to 256 GB (uses SIM 2 slot).</span></li>\n<li><span style=\"font-family: Manrope;\">OS: Android 6.0.1 (Marshmallow), upgradable to 7.1.1 (Nougat).</span></li>\n<li><span style=\"font-family: Manrope;\">Chipset: Qualcomm MSM8956 Snapdragon 650, CPU: Hexa-core (4x1.4 GHz Cortex-A53 &amp; 2x1.8 GHz Cortex-A72),</span></li>\n<li><span style=\"font-family: Manrope;\">Camera: 23 MP, f/2.0, 24mm, phase detection autofocus, LED flash, Secondary: 13 MP, f/2.0, 22mm, 1/3\" sensor size, 1080p.</span></li>\n<li><span style=\"font-family: Manrope;\">Unlocked cell phones are compatible with GSM carrier such as AT&amp;T and T-Mobile, but are not compatible with CDMA carriers such as Verizon and Sprint.</span></li>\n<li><span style=\"font-family: Manrope;\">Please check if your GSM cellular carrier supports the bands for this model before purchasing, LTE may not be available in all regions: 2G bands: GSM 850 / 900 / 1800 / 1900 - SIM 1 &amp; SIM 2, 3G bands: HSDPA 800 / 850 / 900 / 1700(AWS) / 1900 / 2100, 4G bands: LTE band 1(2100), 2(1900), 3(1800), 4(1700/2100), 5(850), 7(2600), 8(900), 12(700), 17(700), 19(800), 20(800), 26(850), 28(700), 38(2600), 39(1900), 40(2300), 41(2500).</span></li>\n</ul>\n<p></p>\n',15,'2022-01-06 16:55:44'),(30,'<h2><span style=\"font-family: Manrope;\">Speed and beyond</span></h2>\n<p><span style=\"font-family: Manrope;\">The Xperia 1 III combines its predecessor\'s remarkable AF speed with new optics reaching up to 105 mm. Together with the astonishing 4K HDR OLED 120Hz refresh rate display, and exceptional audio and gaming, this is a smartphone that goes above and beyond your expectations.</span></p>\n<p></p>\n<p><span style=\"font-family: Manrope;\">Experience breathtaking speed in everything you do</span></p>\n<p><span style=\"font-family: Manrope;\">Speed is at the very heart of the Xperia 1 III experience-from the immersive 4K HDR OLED display with its rapid 120Hz refresh rate to the triple lens camera which features fast AF even when shooting extended telephoto.</span></p>\n<h2><span style=\"font-family: Manrope;\">For photographers</span></h2>\n<h3><span style=\"font-family: Manrope;\">Professional technology from Alpha cameras</span></h3>\n<p><span style=\"font-family: Manrope;\">The Xperia 1 III was co-developed with the engineers behind the latest Alpha 9 series cameras, renowned for their industry-leading autofocus technology, and with input from professional photographers, who helped tune the technology and refine the photographic experience and results. Key features include fast AF in all three cameras, plus Real-Time Tracking technology for accurate shots of moving subjects.</span></p>\n<h3><span style=\"font-family: Manrope;\">Outstanding ZEISS quality in your Xperia</span></h3>\n<p><span style=\"font-family: Manrope;\">ZEISS optics calibrated specifically for your Xperia smartphone. The ZEISS T coating contributes to exquisite rendering and contrast by reducing reflections.</span></p>\n<h3><span style=\"font-family: Manrope;\">Four versatile lens options to unleash your creativity</span></h3>\n<p><span style=\"font-family: Manrope;\">Expand your creative possibilities with four versatile lenses in a triple camera and fast, accurate AF across all cameras. Thanks to Dual PDAF sensors, Continuous AF keeps focus on moving subjects, while Sony\'s unique telephoto system supports fast AF even at extended focal lengths.</span></p>\n<h3><span style=\"font-family: Manrope;\">Lightning fast focus, even at long range</span></h3>\n<p><span style=\"font-family: Manrope;\">An optical telephoto lens up to 105 mm with fast AF lets you capture moving subjects even at a distance. Crucially, the two focal lengths are included in one telephoto module, complete with Dual PDAF sensors. So when you switch between 70 mm and 105 mm, the focal lens unit and the AF lens unit work in unison to focus fast.</span></p>\n<p></p>\n<p><span style=\"font-family: Jetbrains Mono;\"><ins>https://www.gsmarena.com/sony_xperia_1_iii-review-2287.php</ins></span></p>\n',16,'2022-01-06 17:08:15');

